import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './Components/Navbar'; // Import your Navbar
import Footer from './Components/Footer'; // Import your Footer
import BirdList from './Components/BirdList'; // Ensure BirdList is correct
import BirdDetail from './Components/BirdDetail'; // Ensure BirdDetail path is correct
import './App.css'; // Your CSS file

function App() {
  const birds = [
    { id: 1, name: 'Cardinal' },
    { id: 2, name: 'Blue Jay' },
    { id: 3, name: 'Hummingbird' },
    { id: 4, name: 'Eagle' },
    { id: 5, name: 'Sparrow' }
  ];

  return (
    <Router>
      <Navbar /> {/* Your header component */}
      
      {/* Main content for different routes */}
      <Routes>
        <Route path="/" element={<BirdList birds={birds} />} />
        <Route path="/bird/:id" element={<BirdDetail birds={birds} />} />
      </Routes>
      
      <Footer /> {/* Your footer component */}
    </Router>
  );
}

export default App;
